export const getEvents = (locat) => {
    let myHeader = new Headers();
    myHeader.append("Access-Control-Allow-Origin", "http://192.168.0.3:3000/")
    return fetch("http://api.eventful.com/json/events/search?app_key=HkgwXkPs5xHpDpR2&location="+locat)
        .then((res) => {
            console.log(res);
        });
}
